import numpy

# Regression matricies
# Coefficients found from computing a regression
REGRESS_POS = numpy.array([
	10.4057148317285,
	19.2308637576268,
	-28.0069814363066,
	0.538345157223900,
	2.43582334609334,
	0.114989023420495,
	-0.00141654126081140,
	-0.0562210289442525,
	-0.0165914277710677,
	0.0372129746973315
])
REGRESS_INT = numpy.array([
	13.6300069850155,
	21.1538750652992,
	-29.8426218533122,
	4.35774265107037,
	0.875791160518503,
	0.190681707256170,
	-0.0220086058048985,
	-0.103161232344512,
	0.0946518921653804,
	-0.0714358993032020
])

def classify(data):
	results = []
	for song in data:
		data = song["data"][0]
		# Augment with 1's for intercept
		subset = [1] + data[0:9]
		positivity = numpy.dot(REGRESS_POS, numpy.array(subset))
		intensity = numpy.dot(REGRESS_INT, numpy.array(subset))
		results.append({
			"song": {
				"title": song["name"],
				"energy": _normalize(intensity),
				"positivity": _normalize(positivity)
			}
		})
	return {
		"ClassifierResults": results
	}

def _normalize(datum):
	# Takes a piece of data from 0 - 10 and scales it to 0 - 1
	# Data less than zero will be forced to 0, data greater than 10 will be forced to 1
	datum_norm = datum / 10.0;
	if datum_norm > 1.0: 
		datum_norm = 1.0
	elif datum_norm < 0.0:
		datum_norm = 0.0
	return datum_norm


























